import { once } from './once';
test('should call only once', function () {
    var mock = jest.fn(function () { return ({}); });
    var wrapped = once(mock);
    var ret1 = wrapped();
    expect(mock).toHaveBeenCalledTimes(1);
    var ret2 = wrapped();
    expect(mock).toHaveBeenCalledTimes(1);
    expect(ret1).toBe(ret2);
});
